import React, { useState, useEffect, useCallback } from "react";
import "./App.css";

function App() {
  const [videos, setVideos] = useState([]);
  const [selectedVideo, setSelectedVideo] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [isVideoLoading, setIsVideoLoading] = useState(false);
  const [videoUrl, setVideoUrl] = useState(null);
  const [error, setError] = useState(null);
  const [selectedVideoMetadata, setSelectedVideoMetadata] = useState(null);

  // Fetch video list when the component mounts
  useEffect(() => {
    fetchVideos();
  }, []); // Empty dependency ensures this runs once on mount

  // Function to fetch all video data from the server
  const fetchVideos = async () => {
    setIsLoading(true);
    setError(null);  // Reset error before fetching
    try {
      const response = await fetch("http://127.0.0.1:5000/api/videos");
      if (!response.ok) throw new Error("Failed to fetch video list.");
      const data = await response.json();
      setVideos(data);
    } catch (err) {
      console.error("Error fetching videos:", err);
      setError("There was an issue loading the videos. Please try again later.");
    } finally {
      setIsLoading(false);
    }
  };

  // Memoize handleVideoClick to avoid unnecessary re-renders
  const handleVideoClick = useCallback(async (filename) => {
    setSelectedVideo(filename);
    setIsVideoLoading(true);
    setError(null);  // Reset error before fetching

    const { videoStreamUrl, metadata, error } = await fetchVideoStream(filename);

    if (videoStreamUrl && metadata) {
      setVideoUrl(videoStreamUrl);
      setSelectedVideoMetadata(metadata);  // Store the metadata
    } else {
      setError(error || "Failed to fetch the video stream. Please try again.");
    }
    setIsVideoLoading(false);
  }, []);

  // Function to fetch video stream URL and metadata
  const fetchVideoStream = async (filename) => {
    try {
      const response = await fetch(`http://127.0.0.1:5000/api/video/${filename}`);
      if (!response.ok) throw new Error("Failed to fetch video stream.");
      const data = await response.json();

      if (data.presigned_url && data.metadata) {
        return { videoStreamUrl: data.presigned_url, metadata: data.metadata };
      } else {
        throw new Error("No presigned URL or metadata found.");
      }
    } catch (err) {
      console.error("Error fetching video stream:", err);
      return { error: "Error fetching the video stream." };
    }
  };

  return (
    <div className="App">
      <h1 className="title">Video Library</h1>

      {/* Show loading state for videos */}
      {isLoading ? (
        <p className="loading-text">Loading videos...</p>
      ) : error ? (
        <p className="error-message">{error}</p>
      ) : videos.length > 0 ? (
        <div className="video-list">
          <ul>
            {videos.map((video, index) => (
              <li key={index} className="video-item">
                <button className="video-button" onClick={() => handleVideoClick(video.filename)}>
                  {video.title}
                </button>
              </li>
            ))}
          </ul>
        </div>
      ) : (
        <p className="no-videos">No videos available. Please try again later.</p>
      )}

      {/* Display selected video player */}
      {selectedVideo && videoUrl && (
        <div className="video-player">
          <h2 className="video-title">Now Playing: {selectedVideo}</h2>
          {isVideoLoading ? (
            <p className="loading-video">Loading video...</p>
          ) : (
            <div className="video-container">
              <video controls width="800" height="450" src={videoUrl}>
                Your browser does not support the video tag.
              </video>
            </div>
          )}

          {/* Display metadata */}
          {selectedVideoMetadata && (
            <div className="video-metadata">
              <h3>Video Specifications:</h3>
              <ul>
                <li><strong>Title:</strong> {selectedVideoMetadata.title}</li>
                <li><strong>Description:</strong> {selectedVideoMetadata.description}</li>
                <li><strong>Filename:</strong> {selectedVideoMetadata.filename}</li>
                <li><strong>Size:</strong> {selectedVideoMetadata.size}</li>
                <li><strong>Duration:</strong> {selectedVideoMetadata.duration}</li>
              </ul>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
